-- ----------------------------
-- View structure for comment_view
-- ----------------------------
DROP VIEW IF EXISTS `comment_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `comment_view` AS select `bind_comment`.`comment_id` AS `comment_id`,`bind_comment`.`user_id` AS `user_id`,`bind_comment`.`pid` AS `pid`,`bind_comment`.`body` AS `body`,`bind_comment`.`create_time` AS `create_time`,`bind_user`.`username` AS `username`,`bind_user`.`nickname` AS `nickname` from (`bind_comment` join `bind_user`) where (`bind_comment`.`user_id` = `bind_user`.`username`) ;

-- ----------------------------
-- View structure for new_view
-- ----------------------------
DROP VIEW IF EXISTS `new_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `new_view` AS select `bind_new`.`new_id` AS `new_id`,`bind_new`.`body` AS `body`,`bind_new`.`images` AS `images`,`bind_new`.`create_time` AS `create_time`,`bind_new`.`star_count` AS `star_count`,`bind_new`.`up_count` AS `up_count`,`bind_new`.`comment_count` AS `comment_count`,`bind_new`.`user_id` AS `user_id`,`bind_new`.`tags` AS `tags`,`bind_user`.`username` AS `username`,`bind_user`.`nickname` AS `nickname` from (`bind_new` join `bind_user`) where (`bind_user`.`id` = `bind_new`.`user_id`) ;
